text:
a little bit about the artist:
catherine jane fisher was the first woman to break the silence in japan.  she became the first woman to win a court case for $1 when her japanese tokyo district court trial victory was endorsed in the courts of milwaukee, wisconsin usa. the $1 was a sacrifice she made for all victims in japan, especially for the people of okinawa. we are happy to see that more people are coming forward with their stories recently after fisher struggled to pave the way for them even during her illness which was not made public until now. currently her artwork titled #bigbang is on #exhibition at #shibuya at uematsu building next to #hikarie ;
;
#catherinejanefisher  #onestepatatime #empowertarian #empoweringlives #alllivesmatter #nevergiveup  #mystory #metoo #metoojapan #survivor #godsmiracles #mytestimony #breakingthesilence 
for more  #artwork please see here üëâüèºüëâüèºüëâüèº
